"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Headache (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/headache-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H471877300\">",
"      <span class=\"h1\">",
"       Are there different types of headache?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. There are different types of headache. The two most common types are:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Tension headaches",
"        </strong>",
"        &ndash; Tension headaches cause pressure or tightness on both sides of the head.",
"       </li>",
"       <li>",
"        <strong>",
"         Migraine headaches",
"        </strong>",
"        &ndash; Migraine headaches often start off mild and then get worse. They often affect just one side of the head. They can cause nausea or vomiting, or make you sensitive to light and sound.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H471877307\">",
"      <span class=\"h1\">",
"       Is there anything I can do to feel better when I have a headache?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Some people feel better if they:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Lie down in a cool, dark, quiet room (this works best for migraine headaches)",
"       </li>",
"       <li>",
"        Take non-prescription pain medicines (but check with your doctor before taking any new medicines if you have a health condition or already take prescription medicines)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H471877314\">",
"      <span class=\"h1\">",
"       Is there anything I can do to keep from getting headaches?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Some people find that their headaches are triggered by certain foods or things they do. To keep from getting headaches in the future, you can keep a &ldquo;headache diary.&rdquo; In the diary, write down every time you have a headache and what you ate and did before it started. That way you can find out if there is anything you should avoid eating or doing.",
"     </p>",
"     <p>",
"      Some common headache triggers include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Skipping meals or eating too little",
"       </li>",
"       <li>",
"        Having too little or too much caffeine",
"       </li>",
"       <li>",
"        Sleeping too much or too little",
"       </li>",
"       <li>",
"        Certain foods, such as red wine, aged cheese, and hot dogs",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Some women get migraine headaches just before they get their period. If that happens to you, mention it to your doctor or nurse. There are medicines that can help.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H471877321\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See a doctor or nurse right away if:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Your headache comes on suddenly, quickly becomes severe, or could be described as \"the worst headache of your life\"",
"       </li>",
"       <li>",
"        Your headache is severe and you also have a fever or stiff neck",
"       </li>",
"       <li>",
"        You also have a seizure, personality changes or confusion, or you pass out",
"       </li>",
"       <li>",
"        Your headache began right after you exercised or had a minor injury",
"       </li>",
"       <li>",
"        You have not had headaches before and you also have weakness, numbness, or trouble seeing (migraine headaches can sometimes cause these symptoms, but you should be seen right away the first time these symptoms happen)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      You should also see a doctor or nurse if you get headaches often or your headaches are severe.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H471877328\">",
"      <span class=\"h1\">",
"       How is headache treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There are lots of prescription and non-prescription medicines that can ease the pain of headaches. There are also prescription medicines that can help prevent headaches from happening in the first place.",
"     </p>",
"     <p>",
"      The right medicine for you will depend on what type of headaches you get, how often you get them, and how bad they are.",
"     </p>",
"     <p>",
"      If you get headaches often, work with your doctor to find a treatment that helps. Do not try to manage frequent headaches on your own with non-prescription pain medicines. Taking non-prescription pain medicines too often can actually cause more headaches later.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H471877335\">",
"      <span class=\"h1\">",
"       What should I know if my child gets a headache?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Children can get the same types of headaches that adults get. But they can also get headaches in situations when adults don&rsquo;t usually get them. For instance, children often get headaches when they have a cold.",
"     </p>",
"     <p>",
"      Take your child to the doctor right away (without giving any medicines) if your child has a headache that:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Started after a head injury",
"       </li>",
"       <li>",
"        Is severe or happens with other symptoms, such as:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Fever (temperature greater than 100.4&ordm;F or 38&ordm;C)",
"       </li>",
"       <li>",
"        Vomiting",
"       </li>",
"       <li>",
"        Changes in vision or double vision",
"       </li>",
"       <li>",
"        Neck pain or stiffness",
"       </li>",
"       <li>",
"        Confusion",
"       </li>",
"       <li>",
"        Loss of balance or unsteadiness",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      You should also take your child to see a doctor or nurse if he or she gets headaches more than once a month.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H471877342\">",
"      <span class=\"h1\">",
"       More on this topic",
