var title_f3_31_3580="Guidelines after polypectomy II";
var content_f3_31_3580=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F51969&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F51969&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Additional surveillance considerations",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        1. The present recommendations assume that colonoscopy is complete to the cecum and that bowel preparation is adequate; a repeat examination should be performed if the bowel preparation is not adequate before planning a long-term surveillance program",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. There is clear evidence that the quality of examinations is highly variable; continuous quality improvement process is critical to the effective application of colonoscopy in colorectal cancer prevention",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. A repeat examination is warranted if there is a concern that the polyp was removed incompletely, particularly if it shows high grade dysplasia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4. Endoscopists should make clear recommendations to primary care physicians about when the next colonoscopy is indicated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5. Given the evolving nature of guidelines, it is important that physicians and patients should remain in contact so that surveillance recommendations reflect changes in guidelines",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        6. Pending further investigation, performance of FOBT is discouraged in patients undergoing colonoscopic surveillance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        7. Discontinuation of surveillance colonoscopy should be considered in patients with serious comorbidities with less than 10 years of life expectancy, according to the clinician's judgment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        8. Surveillance guidelines are intended for asymptomatic people; new symptoms may need diagnostic work-up",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        9. The application of evolving technologies such as chromoendoscopy, magnification endoscopy, narrow band imaging, and computed tomography colonography are not established for postpolypectomy surveillance at this time",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Winawer SJ, Zauber AG, Fletcher RH, et al. Guidelines for colonoscopy surveillance after polypectomy: a consensus update by the US Multi-Society Task Force on Colorectal Cancer and the American Cancer Society. Gastroenterology 2006; 130:1872. Copyright &copy; 2006 American Gastroenterological Association.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
