var title_f3_31_3582="Water shifts in hemodialysis";
var content_f3_31_3582=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F53752&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F53752&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 517px\">",
"   <div class=\"ttl\">",
"    Water movement during standard hemodialysis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 497px; height: 202px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Schematic representation of water movement during standard hemodialysis. Plasma at an osmolality of 320 mosmol/kg flows into the dialyzer (step 1) which is perfused with a dialysate having an osmolality of 280 mosmol/kg. Diffusive loss of urea (and other small solutes) lowers the osmolality of the fluid returning to the patient (step 2). The ensuing fall in extracellular osmolality creates an osmotic gradient favoring water movement into the cells. This effect plus water loss by ultrafiltration across the dialyzer leads to extracellular volume depletion and may cause hypotension. The rapid fall in plasma osmolality also may play a contributory role, perhaps by interfering with sympathetic responsiveness to volume depletion.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
